import store from "./redux-store";

let initialState = {
  games: {
    gameFoto: "https://upload.wikimedia.org/wikipedia/uk/3/35/Fortnite_poster.png",
    gameName: "Fortnite",
    developer: "Epic Games Store",
    gamePrice: "Free"
  }
};

const shopReducer = (state = initialState, action) => {
  return state;
};

export default shopReducer;
